import React, { Fragment } from "react";
import Tour from './Tour'
import { Container, Row, Col } from "react-bootstrap";

const Tours = ({ tours }) => {
    return (
        <Fragment>
            <Container>
            <div>OUR TOURS</div>
                <Col>
                {tours.map((tour) => {
                    return <Tour key={tour.id} {...tour}></Tour>
                })}
                </Col>
            </Container>
        </Fragment>

    );
};

export default Tours;
